import { browserHistory, Router, Route, Redirect, Switch } from 'react-router';
import React from 'react';
import {Home} from './views/Home';
import {About} from './views/About';
import {NoMatch} from './views/NoMatch';

import {Navbar} from './components/Navbar';



export const Routes = () => {
      return (
            <div>
                  <Navbar/>
                  <Switch>
                        <Match exact path="/Home" component={Home}/>
                        <Match exact path="/">
                              <Redirect to="/Home"/>
                        </Match>
                        <Match exact path="/About" component={About}/>
                        <Match component={NoMatch}/>

                  </Switch>
            </div>
      );
};
